import {Canvas} from "@react-three/fiber";

export default function SectionThree() {
    return (
        <Canvas>
            <ambientLight intensity={1}/>
            <directionalLight position={[5,2,1]}/>
            <mesh>
                <boxGeometry args={[4,4,4]} rotation={{x: 5}}/>
                <meshStandardMaterial color={"red"}/>
            </mesh>
        </Canvas>
    )
}
